import React from 'react';
import TopBar from './TopBar.js'
import Widget from './Widget.js';

export default function PageLayout({children}) {
    return (
        <div style={{
            display: 'grid',
            gridTemplateAreas: `'topbar' 'content'`
        }}>
            <TopBar gridArea="topbar"></TopBar>
            <div style={{
                gridArea: 'content'
            }}>
                <div style={{
                    display: 'flex',
                    position: 'absolute',
                    top: '0',
                    left: '0'
                }}>
                    <Widget>
                        <input type="text" />
                    </Widget>
                </div>
                {children}
            </div>
        </div>
    );
}
